import Head from "next/head";

const Meta = () => (
  <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <link rel="shortcut icon" href="/public/favicon.png" />
    <link
      rel="stylesheet"
      type="text/css"
      href="/public/static/nprogress.css"
    />
    <title>Ripperr</title>
  </Head>
);

export default Meta;
